import React from 'react';

class Signup extends React.Component {
    render() {
        return (
            <form>
                <label>
                    Nome:
                    <input type="text" placeholder="Nome"/>
                </label>
                <label>
                    Email:
                    <input type="text" placeholder="Email"/>
                </label>
                <label>
                    Senha:
                    <input type="text" placeholder="Senha"/>
                </label>
                <input type="submit"/>
            </form>
        )
    }
}

export default Signup;
